func numberOfSubstrings(s string) int {
	res := 0
	l := 0
	m := map[byte]int{'a': 0, 'b': 0, 'c': 0}
	for i := 0; i < len(s); i++ {
		m[s[i]]++
		for m['a'] > 0 && m['b'] > 0 && m['c'] > 0 {
			m[s[l]]--
			l++
		}
		res += l
	}
	return res
}
func TestNumberOfSubstrings(t *testing.T) {
	tests := []struct {
		s      string
		output int
	}{
		{
			"", 49998,
		},
		{
			"", 1244858478,
		},
	}
	for i, ts := range tests {
		t.Run(fmt.Sprintf("Example %d", i+1), func(t *testing.T) {
			ast := assert.New(t)
			ast.Equal(ts.output, numberOfSubstrings(ts.s))
		})
	}
}
